import React, {useState} from 'react'
import "./ButtonBuy.scss"

const ButtonForBuy = () => {
    const [setBuyNowActive] = useState(false)
    return (
        <div className="wrap">
            <button onClick={() => setBuyNowActive(true)} className="ButtonBuy">Купить</button>
        </div>
    )
}

export default ButtonForBuy;
